const navegador=function(){let e=navigator.userAgent.toLowerCase();if(-1!==e.indexOf("firefox"))return"firefox";if(-1!==e.indexOf("edge")||-1!==e.indexOf("edg"))return"edge";if(-1!==e.indexOf("opr")||-1!==e.indexOf("opera"))return"opera";if(-1!==e.indexOf("chrome"))return"chrome";if(-1!==e.indexOf("safari"))return"safari";else return"desconocido"}();